import React from 'react';
import { render } from '@testing-library/react';
import App from './App';

export default function ScoreCard({Player1,Player2}) {
	return(
		<section className="c-score-card">
		<div className="c-score-card__player Player1-card"> </div>
		<div className="c-score-card__space"> </div>
		<div className="c-score-card__player Player2-card"> </div>
		</section>
		)
}

ScoreCard.propTypes = {
	Player1: PropTypes.number.isRequired,
	Player2:PropTypes.number.isRequired
}
